import React from 'react';
import Form from '../atoms/Form/Form';
import Input from '../atoms/Form/Input';

function FormLogin() {
    return (
        <Form>
            <div>
                <Input as="email" name="email" label="email" />
                <Input as="password" name="password" label="password" />
            </div>
        </Form>
    );
}

export default FormLogin;
